import "../components/home.css";
export function Home() {
  return (
    <>
      <div className="banner"></div>
      <h4>Product Category</h4>
      <div className="product">
    
        <div className="card-1"></div>
        <div className="card-2"></div>
        <div className="card-3"></div>
      </div>
    </>
  );
}
